import { Outlet, Route, Routes } from "react-router-dom"
import { Home } from "./home/Home"
import { NavBar } from "./components/NavBar"

export const ParentsView = ({ user }) => {
    return (
        <Routes>
            <Route path="/" element={
                <>
                    <NavBar />
                    <Outlet />
                </>
            }>
                <Route index element={<Home user={user} />} />
            </Route>
        </Routes>
    )
}
